{

  const Box = (props) =>
  {
    const [data_array,setDataArray] = React.useState(Data);
    const bg_color = {
      backgroundColor : props.on ? "white" : "black"
    }
    return (
      <div className="box" style={bg_color} onClick = {props.handleClick(props.id)}></div>
    )
  }
  const things_array = data_array.map(function(x)
  {
  function handleClick(value)
  {
    console.log("I'm clicked",value);
  }
    return <Box on = {x.on} handleClick = {handleClick} id = {x.id}/>
  })
  return things_array;
}

